import React from "react";

const ProjectsExp = props => {
  return (
    <div className="col-lg-6 ">
      <h1 className={props.className}>
        {" "}
        <i class="fas fa-code"></i>
        {props.title}{" "}
      </h1>
      {props.data.map(experience => (
        <div>
          <h1 key={experience.id}>{experience.profession}</h1>
          <em>{experience.profession}</em>
          <p>{experience.years}</p>
          <p>{experience.competences} </p>
        </div>
      ))}
    </div>
  );
};

export default ProjectsExp;
